import React, { useState, useEffect } from "react";
import { FaHome, FaShoppingCart, FaHeart, FaBell, FaSearch } from "react-icons/fa";
import { useNavigate } from "react-router-dom";
import "./homePage.css";

const HomePage = ({ cart, setCart }) => {
  const [categories, setCategories] = useState([]);
  const [activeCategory, setActiveCategory] = useState("All");
  const [products, setProducts] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [isPopupOpen, setIsPopupOpen] = useState(false);
  const [selectedExtras, setSelectedExtras] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchedCategories = ["All", "Popular", "Pizza", "Burger", "Pasta", "Drinks", "Desserts"];
    setCategories(fetchedCategories);

    const sampleProducts = [
      {
        id: 1,
        name: "Cheese Pizza",
        description: "With Extra Cheese",
        price: 9.99,
        image: "pizza.jpg",
        category: "Pizza",
        extras: [
          { name: "Extra Cheese", price: 2 },
          { name: "Olives", price: 1 }
        ],
      },
      {
        id: 2,
        name: "Veggie Burger",
        description: "With Fresh Vegetables",
        price: 7.99,
        image: "burger.jpg",
        category: "Burger",
        extras: [{ name: "Extra Patty", price: 3 }],
      },
    ];
    setProducts(sampleProducts);
  }, []);

  const handleAddToCart = (product, e) => {
    e.stopPropagation();
    setSelectedProduct(product);
    setSelectedExtras([]);
    setIsPopupOpen(true);
  };

  const toggleExtra = (extra) => {
    setSelectedExtras((prev) => {
      const exists = prev.find((e) => e.name === extra.name);
      return exists ? prev.filter((e) => e.name !== extra.name) : [...prev, extra];
    });
  };

  const confirmAddToCart = () => {
    const totalExtraPrice = selectedExtras.reduce((sum, extra) => sum + extra.price, 0);
    const finalPrice = selectedProduct.price + totalExtraPrice;
    setCart((prevCart) => [
      ...prevCart,
      { ...selectedProduct, extras: selectedExtras, quantity: 1, finalPrice },
    ]);
    setIsPopupOpen(false);
    alert(`${selectedProduct.name} added to cart with extras!`);
  };

  return (
    <div className="homepage">
      <header className="header">
        <h1>Find the best food for you</h1>
      </header>

      <div className="search-bar">
        <input type="text" placeholder="Find Your Food..." />
        <FaSearch className="search-icon" />
      </div>

      <div className="category-container">
        <div className="category-scroll">
          {categories.map((category) => (
            <button
              key={category}
              className={`category-button ${activeCategory === category ? "active" : ""}`}
              onClick={() => setActiveCategory(category)}
            >
              {category}
            </button>
          ))}
        </div>
      </div>

      <div className="product-grid">
        {products.map((product) => (
          <div
            key={product.id}
            className="product-card"
            onClick={() => navigate(`/detail`, { state: { product } })}
          >
            <img src={product.image} alt={product.name} className="product-image" />
            <h3>{product.name}</h3>
            <p>{product.description}</p>
            <div className="product-footer">
              <span>${product.price.toFixed(2)}</span>
              <button className="add-to-cart" onClick={(e) => handleAddToCart(product, e)}>
                +
              </button>
            </div>
          </div>
        ))}
      </div>

      {isPopupOpen && selectedProduct && (
        <div className="popup-overlay">
          <div className="popup">
            <h2>{selectedProduct.name}</h2>
            <p>{selectedProduct.description}</p>
            <p>Base Price: ${selectedProduct.price.toFixed(2)}</p>
            <h3>Select Extras:</h3>
            {selectedProduct.extras.map((extra) => (
              <div key={extra.name}>
                <input
                  type="checkbox"
                  id={extra.name}
                  onChange={() => toggleExtra(extra)}
                />
                <label htmlFor={extra.name}>{extra.name} (+${extra.price})</label>
              </div>
            ))}
            <p>Total: ${(selectedProduct.price + selectedExtras.reduce((sum, extra) => sum + extra.price, 0)).toFixed(2)}</p>
            <button onClick={confirmAddToCart}>Confirm</button>
            <button onClick={() => setIsPopupOpen(false)}>Cancel</button>
          </div>
        </div>
      )}

      <footer className="footer-nav">
        <FaHome className="nav-icon" />
        <FaShoppingCart onClick={() => navigate("/CartPage")} size={24} className="nav-icon" />
        <FaHeart className="nav-icon" />
        <FaBell className="nav-icon" />
      </footer>
    </div>
  );
};

export default HomePage;
